import React from "react"; 
import { BrowserRouter, Route, Link, useLocation } from "react-router-dom"; 
function Navbar() {   
    return (    
        <nav>       
            <ul>         
                <li>           
                    <Link to="/">Home</Link>         
                </li>        

                <li>           
                    <Link to="/projects">Projects</Link>        
                </li>           
            </ul>     
        </nav>   
    ); 
} export default Navbar;
